import jsonData from '../data/data.json';
import "../styles/Contacts.css"; 

function Contacts() {
    return (
    <div className='contacts' id='contacts'>
        <h3>Contacts</h3>
        <ul>
            <li>{jsonData.francais.contact[0].telephone} : {jsonData.informations.telephone}</li>
            <li>{jsonData.francais.contact[0].city} : {jsonData.informations.city}</li>
            <li>{jsonData.francais.contact[0].mail}: {jsonData.informations.mail}</li>
            <li>{jsonData.francais.contact[0].linkedin}: {jsonData.informations.linkedin}</li>
            <li>{jsonData.francais.contact[0].github}: {jsonData.informations.g}</li>
        </ul>
        
    
       
    </div>
    );
}

export default Contacts;
